import React from "react";
import { NavLink } from "react-router-dom";

class Home extends React.Component {
  render() {
    return (
      <div>
        <h1>Home Page </h1>
        <NavLink>
        <button>Report missing pet</button>
        <button>Report found pet</button>
        </NavLink>
      </div>
    );
  }
}

export default Home;
